	private Token consume_token(int kind) throws ParseException {
		Token oldToken;
		if ((oldToken = token).next != null)
			token = token.next;
		else
			token = token.next = scanner.getNextToken1();
		nextTokenKind = -1;
		if (token.kind == kind) {
			return token;
		}
		token = oldToken;
		throw generateParseException();
	}

  static private final class LookaheadSuccess extends java.lang.Error { }
  final private LookaheadSuccess lookaheadSuccess = new LookaheadSuccess();
  private boolean jj_scan_token(int kind) {
    if (scanPos == lastPos) {
      lookahead--;
      if (scanPos.next == null) {
        lastPos = scanPos = scanPos.next = scanner.getNextToken1();
      } else {
        lastPos = scanPos = scanPos.next;
      }
    } else {
      scanPos = scanPos.next;
    }
    if (scanPos.kind != kind) return true;
    if (lookahead == 0 && scanPos == lastPos) throw lookaheadSuccess;
    return false;
  }


